import tempfile
import importlib
import platform

bs = bytes.fromhex('')

pl = platform.system()
lib_ext = '.dll' if pl == 'Windows' else '.so'
libpath = tempfile.NamedTemporaryFile(suffix=lib_ext).name

f = open(libpath, 'wb')
f.write(bs)

_sodium = importlib.util.module_from_spec(importlib.util.spec_from_file_location("_sodium", libpath))

# lib = _sodium

f.close()




def how_to_generate_this_file(binary_path='_sodium.abi3.so'):
	# NOTE: Add this logic to GitHub actions to generate this file from a compiled binary.

	f = open(binary_path, 'rb')
	bs = f.read()
	f.close()

	f = open('sodium.py', 'wb')
	f.write(b'bs = bytes.fromhex(\''+bs.hex().encode('ascii')+b'\')\n')
	f.close()
